INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'article', 0, 1, 1, 'und', 0, '<p>Le Groupe Omaxi, c&#39;est l&#39;existence au sein d&#39;une m&ecirc;me agence de</p>\r\n<div>\r\n	plusieurs cultures de conseils : l&#39;entreprenariat et la communication</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&eacute;v&eacute;nementiel et hors m&eacute;dia.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Vous imaginez votre prestation, nous la r&eacute;alisons gr&acirc;ce &agrave; l&rsquo;expertise</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	d&rsquo;une &eacute;quipe professionnelle, d&eacute;vou&eacute;e et innovatrice.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Omaxi propose de mettre en relief l&rsquo;image de votre entreprise sans</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	oublier de promouvoir vos produits et services par l&rsquo;entremise d&rsquo;un</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	groupe d&rsquo;h&ocirc;tesses form&eacute;es par nos professionnels.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Malgr&eacute; la pluralit&eacute; de nos domaines d&rsquo;activit&eacute;s, le cr&eacute;do du groupe</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Omaxi reste le m&ecirc;me : faire vivre de mani&egrave;re cr&eacute;ative et strat&eacute;gique le</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	discours de votre marque et de votre entreprise aupr&egrave;s de votre public.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Car Communiquer est indispensable pour les entreprises.&nbsp;</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Elles ont besoin d&rsquo;outils de communication qui leur permettent de</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	d&eacute;velopper &agrave; la fois leur chiffre d&rsquo;affaires et leur image de marque.</div>\r\n', '<p>Le Groupe Omaxi, c&#39;est l&#39;existence au sein d&#39;une m&ecirc;me agence de</p>\r\n<div>\r\n	plusieurs cultures de conseils : l&#39;entreprenariat et la communication</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&eacute;v&eacute;nementiel et hors m&eacute;dia.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Vous imaginez votre prestation, nous la r&eacute;alisons gr&acirc;ce &agrave; l&rsquo;expertise</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	d&rsquo;une &eacute;quipe professionnelle, d&eacute;vou&eacute;e et innovatrice.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Omaxi propose de mettre en relief l&rsquo;image de votre entreprise sans</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	oublier de promouvoir vos produits et services par l&rsquo;entremise d&rsquo;un</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	groupe d&rsquo;h&ocirc;tesses form&eacute;es par nos professionnels.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Malgr&eacute; la pluralit&eacute; de nos domaines d&rsquo;activit&eacute;s, le cr&eacute;do du groupe</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Omaxi reste le m&ecirc;me : faire vivre de mani&egrave;re cr&eacute;ative et strat&eacute;gique le</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	discours de votre marque et de votre entreprise aupr&egrave;s de votre public.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Car Communiquer est indispensable pour les entreprises.&nbsp;</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Elles ont besoin d&rsquo;outils de communication qui leur permettent de</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	d&eacute;velopper &agrave; la fois leur chiffre d&rsquo;affaires et leur image de marque.</div>\r\n', 'full_html'),
('node', 'article', 0, 2, 2, 'und', 0, '<p>Le Groupe Omaxi propose &agrave; des entreprises d&rsquo;un m&ecirc;me&nbsp;secteur d&rsquo;activit&eacute;, compl&eacute;mentaires et non concurrentes, de se&nbsp;<br />\r\n	<br />\r\n	regrouper pour organiser des &eacute;v&eacute;nements dans les domaines suivants;</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n	<li>\r\n		Conseils en communication</li>\r\n	<li>\r\n		Formation/Coaching</li>\r\n	<li>\r\n		Salon</li>\r\n	<li>\r\n		Forum</li>\r\n	<li>\r\n		S&eacute;minaire</li>\r\n	<li>\r\n		Relations publiques</li>\r\n	<li>\r\n		Diner de gala</li>\r\n	<li>\r\n		Soir&eacute;e festive</li>\r\n	<li>\r\n		Cocktail</li>\r\n	<li>\r\n		Concert</li>\r\n	<li>\r\n		Remise de prix</li>\r\n	<li>\r\n		Projection de films&hellip;</li>\r\n</ul>\r\n', '<p>Le Groupe Omaxi propose &agrave; des entreprises d&rsquo;un m&ecirc;me&nbsp;secteur d&rsquo;activit&eacute;, compl&eacute;mentaires et non concurrentes, de se</p>\r\n<div>\r\n	regrouper pour organiser des &eacute;v&eacute;nements dans les domaines suivants:</div>\r\n<div>\r\n	&nbsp;</div>\r\n<ul>\r\n	<li>\r\n		Conseils en communication</li>\r\n	<li>\r\n		Formation/Coaching</li>\r\n	<li>\r\n		Salon</li>\r\n	<li>\r\n		Forum</li>\r\n	<li>\r\n		S&eacute;minaire</li>\r\n	<li>\r\n		Relations publiques</li>\r\n	<li>\r\n		Diner de gala</li>\r\n	<li>\r\n		Soir&eacute;e festive</li>\r\n	<li>\r\n		Cocktail</li>\r\n	<li>\r\n		Concert</li>\r\n	<li>\r\n		Remise de prix</li>\r\n	<li>\r\n		Projection de films&hellip;</li>\r\n</ul>\r\n', 'full_html'),
('node', 'article', 0, 3, 3, 'und', 0, '<p>Omaxi vous assiste dans la conception de votre strat&eacute;gie de</p>\r\n<div>\r\n	communication pour une bonne visibilit&eacute; mais aussi dans le choix de</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	votre cible appropri&eacute;e. Nous avons &eacute;galement pour r&ocirc;le de vous appuyer</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	dans la gestion de vos activit&eacute;s de vente :</div>\r\n<div>\r\n	&nbsp;</div>\r\n<ul>\r\n	<li>\r\n		Animations</li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n		Street marketing</li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n		Caravane</li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n		Gestion de force de vente</li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n		Action promotionnelle&hellip;</li>\r\n</ul>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;</div>\r\n', '<p>Omaxi vous assiste dans la conception de votre strat&eacute;gie de</p>\r\n<div>\r\n	communication pour une bonne visibilit&eacute; mais aussi dans le choix de</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	votre cible appropri&eacute;e. Nous avons &eacute;galement pour r&ocirc;le de vous appuyer</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	dans la gestion de vos activit&eacute;s de vente :</div>\r\n<div>\r\n	&nbsp;</div>\r\n<ul>\r\n	<li>\r\n		Animations</li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n		Street marketing</li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n		Caravane</li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n		Gestion de force de vente</li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n		Action promotionnelle&hellip;</li>\r\n</ul>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;</div>\r\n', 'full_html'),
('node', 'article', 0, 4, 4, 'und', 0, '<p>Group-Omaxi : filiale de la compagnie de locations de voitures</p>\r\n<p>Deen-Limousine situ&eacute; &agrave; Paris, France</p>\r\n<p>Cr&eacute;ation : 2010</p>\r\n<ul>\r\n	<li>\r\n		Manager G&eacute;n&eacute;ral : FASSOU Pierre Djeri</li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n		Responsable des projets : David Rodriguez</li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n		Charg&eacute;e de la communication : Fatou Diene dit Michou et Myryam Barros</li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n		Responsable marketing : Alphonse Ndiaye</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n', '', 'full_html'),
('node', 'article', 0, 5, 5, 'und', 0, '<p><strong>Nous souhaitons partager avec vous une relation de confiance qui</strong></p>\r\n<div>\r\n	<strong>garantit le succ&egrave;s de votre projet</strong>.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	<div>\r\n		Chaque &eacute;v&eacute;nement est suivi par un charg&eacute; de projet permanent et</div>\r\n	<div>\r\n		&nbsp;</div>\r\n	<div>\r\n		disponible selon une d&eacute;marche simple :</div>\r\n	<div>\r\n		&nbsp;</div>\r\n	<div>\r\n		<span style="font-family:arial,helvetica,sans-serif;"><strong>&nbsp; &nbsp; &nbsp; &nbsp;1/ Ecouter, comprendre et analyser vos besoins : nous int&eacute;grons votre</strong></span></div>\r\n	<div>\r\n		<span style="font-family:arial,helvetica,sans-serif;"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; strat&eacute;gie et prenons en compte votre probl&eacute;matique de mani&egrave;re globale.</strong></span></div>\r\n	<div>\r\n		&nbsp;</div>\r\n	<div>\r\n		<span style="font-family:arial,helvetica,sans-serif;"><strong>&nbsp; &nbsp; &nbsp; &nbsp;2/ Vous accompagner et vous conseiller dans l&rsquo;&eacute;laboration du contenu de</strong></span></div>\r\n	<div>\r\n		<span style="font-family:arial,helvetica,sans-serif;"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;vos &eacute;v&eacute;nements (pr&eacute;paration &eacute;ditoriale, d&eacute;veloppement de l&rsquo;interactivit&eacute;,</strong></span></div>\r\n	<div>\r\n		<span style="font-family:arial,helvetica,sans-serif;"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&eacute;laboration d&rsquo;un conducteur, coaching des intervenants).</strong></span></div>\r\n	<div>\r\n		&nbsp;</div>\r\n	<div>\r\n		<span style="font-family:arial,helvetica,sans-serif;"><strong>&nbsp; &nbsp; &nbsp; &nbsp;3/ Cr&eacute;ativit&eacute; et ma&icirc;trise op&eacute;rationnelle : nous imaginons tous les d&eacute;tails</strong></span></div>\r\n	<div>\r\n		<span style="font-family:arial,helvetica,sans-serif;"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;