('node', 'article', 0, 1, 1, 'und', 0, '<p>Le Groupe Omaxi, c&#39;est l&#39;existence au sein d&#39;une m&ecirc;me agence de</p>\r\n<div>\r\n	plusieurs cultures de conseils : l&#39;entreprenariat et la communication</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&eacute;v&eacute;nementiel et hors m&eacute;dia.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Vous imaginez votre prestation, nous la r&eacute;alisons gr&acirc;ce &agrave; l&rsquo;expertise</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	d&rsquo;une &eacute;quipe professionnelle, d&eacute;vou&eacute;e et innovatrice.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Omaxi propose de mettre en relief l&rsquo;image de votre entreprise sans</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	oublier de promouvoir vos produits et services par l&rsquo;entremise d&rsquo;un</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	groupe d&rsquo;h&ocirc;tesses form&eacute;es par nos professionnels.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Malgr&eacute; la pluralit&eacute; de nos domaines d&rsquo;activit&eacute;s, le cr&eacute;do du groupe</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Omaxi reste le m&ecirc;me : faire vivre de mani&egrave;re cr&eacute;ative et strat&eacute;gique le</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	discours de votre marque et de votre entreprise aupr&egrave;s de votre public.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Car Communiquer est indispensable pour les entreprises.&nbsp;</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Elles ont besoin d&rsquo;outils de communication qui leur permettent de</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	d&eacute;velopper &agrave; la fois leur chiffre d&rsquo;affaires et leur image de marque.</div>\r\n', '<p>Le Groupe Omaxi, c&#39;est l&#39;existence au sein d&#39;une m&ecirc;me agence de</p>\r\n<div>\r\n	plusieurs cultures de conseils : l&#39;entreprenariat et la communication</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&eacute;v&eacute;nementiel et hors m&eacute;dia.</div>\r\n