INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' presentation le groupe omaxi c est l existence au sein d une même agence de plusieurs cultures de conseils l entreprenariat et la communication événementiel et hors média vous imaginez votre prestation nous la réalisons grâce à l expertise d une équipe professionnelle dévouée et innovatrice omaxi propose de mettre en relief l image de votre entreprise sans oublier de promouvoir vos produits et services par l entremise d un groupe d hôtesses formées par nos professionnels malgré la pluralité de nos domaines d activités le crédo du groupe omaxi reste le même faire vivre de manière créative et stratégique le discours de votre marque et de votre entreprise auprès de votre public car communiquer est indispensable pour les entreprises elles ont besoin d outils de communication qui leur permettent de développer à la fois leur chiffre d affaires et leur image de marque  ', 0),
(2, 'node', ' evenement le groupe omaxi propose à des entreprises d un même secteur d activité complémentaires et non concurrentes de se regrouper pour organiser des événements dans les domaines suivants conseils en communication formation coaching salon forum séminaire relations publiques diner de gala soirée festive cocktail concert remise de prix projection de films  ', 0),
(3, 'node', ' publicité et promotion omaxi vous assiste dans la conception de votre stratégie de communication pour une bonne visibilité mais aussi dans le choix de votre cible appropriée nous avons également pour rôle de vous appuyer dans la gestion de vos activités de vente animations street marketing caravane gestion de force de vente action promotionnelle  ', 0),
(4, 'node', ' l equipe groupomaxi filiale de la compagnie de locations de voitures deenlimousine situé à paris france création 2010 manager général fassou pierre djeri responsable des projets david rodriguez chargée de la communication fatou diene dit michou et myryam barros responsable marketing alphonse ndiaye  ', 0),
(5, 'node', ' notre approche nous souhaitons partager avec vous une relation de confiance qui garantit le succès de votre projet  chaque événement est suivi par un chargé de projet permanent et disponible selon une démarche simple   1 ecouter comprendre et analyser vos besoins nous intégrons votre  stratégie et prenons en compte votre problématique de manière globale    2 vous accompagner et vous conseiller dans l élaboration du contenu de  vos événements préparation éditoriale développement de l interactivité   élaboration d un conducteur coaching des intervenants     3 créativité et maîtrise opérationnelle nous imaginons tous les détails  qui émerveilleront vos invités nous pilotons les talents artistiques et  techniques qui concourent à la réussite de votre événement    4 evaluation de l événement nous proposons et mettons en place des  outils de mesure d impact de l opération   ', 0);
